1.1.1. 第一部分：接口介绍
首先说在 HTML 中定义样式的方式有 3 种：

通过 link 元素包含外部样式表文件
使用 style 元素定义嵌入式样式
使用 style 特性定义针对特定元素的样式

DOM2 级模块围绕这三种应用样式机制提供了一套 API。理解了这套 API 就理解了如何用 JS 操作 CSS 了。这套接口种类很多。如下图：

可以参考MDN这篇文章了解。
接口都是有规律的，死记硬背不好记住，根据 HTML 中定义样式的 3 种方式来看接口的定义，自然就更好理解。
1.1 CSSStyleSheet样式表对象
名字中带有StyleSheet的接口就样式表的意思。CSSStyleSheet接口类型表示的是样式表。包括通过link元素包含的外部样式表和在元素中定义的样式表。CSSStyleSheet接口继承StyleSheet。StyleSheet可以作为一个基础接口来定义非 CSS 样式表。
1.2 CSSRule样式表规则对象
名字中带有Rule的接口就代表规则的意思。CSSRule对象表示样式表中的每一条规则。CSSRule其实 是一个供其他多种类型继承的基类型。其中最常用的就是 CSSStyleRule 类型，表示样式信息。
CSSRule的所有子类型如下：

CSSCharsetRule
CSSConditionRule
CSSCounterStyleRule
CSSFontFeatureValuesRule
CSSGroupingRule
CSSImportRule
CSSKeyframeRule
CSSKeyframesRule
CSSMarginRule
CSSMediaRule
CSSNamespaceRule
CSSPageRule
CSSSupportsRule
CSSViewportRule
CSSFontFaceRule
CSSStyleRule


这些规则很少有必要通过脚本来访问，而最常用的就是 CSSStyleRule 类型。

通过下图可以加深对StyleSheet，CSSRule关系的理解。

1.3 CSSStyleDeclaration 应用在元素 style 属性的对象
任何支持style特性的HTML元素在JavaScript中都有一个对应的style属性。这个style对象是 CSSStyleDeclaration的实例。包含着通过HTML的style特性指定的所有样式信息，但不包含 与外部样式表或嵌入样式表经层叠而来的样式。
我们经常使用的通过HTMLElement.style属性就是返回来CSSStyleDeclaration对象。CSSStyleDeclaration对象表示一个元素的style属性。
1.1.2. 第二部分：CSSStyleSheet类型接口介绍
2.1 StyleSheet 类型支持的属性和方法:
CSSStyleSheet 继承自StyleSheet，StyleSheet作为一个基础接口来定义非 CSS 样式表。从 ，StyleSheet接口继承而来的属性如下：

disabled：表示样式表是否被禁用的布尔值。这个属性是可读/写的，将这个值设置为 true 可 以禁用样式表。
href：如果样式表是通过包含的，则是样式表的 URL;否则，是 null。
media：
ownerNode：指向拥有当前样式表的节点的指针，样式表可能是在 HTML 中通过link(HTMLLinkElement)或style(HTMLStyleElement)引入的。如果当前样式表是其他样式表通过@import 导入的，则这个属性值为 null。IE 不支持这个属性。
parentStyleSheet：在当前样式表是通过@import导入的情况下，这个属性是一个指向导入它的样式表的指针，否则为 null。
title： ownerNode 中 title 属性的值，否则为 null。
type：表示样式表类型的字符串。对 CSS 样式表而言，这个字符串是"type/css"。


CSSStyleSheet 对象则是一 套只读的接口。除了 disabled 属性之外。

2.2 CSSStyleSheet 接口类型支持的属性和方法:
CSSStyleSheet除了继承StyleSheet接口的属性之外，而且还支持下列属性和方法：

cssRules(rules)：样式表中包含的样式规则的集合。IE 不支持这个属性，但有一个类似的 rules 属性。
ownerRule：如果样式表是通过@import导入的，这个属性就是一个指针，指向表示导入的规
则;否则，值为 null。IE 不支持这个属性。
deleteRule(index)：删除cssRules集合中指定位置的规则。IE 不支持这个方法，但支持
一个类似的removeRule()方法。
insertRule(rule,index)：向cssRules集合中指定的位置插入rule字符串。IE 不支持这
个方法，但支持一个类似的addRule()方法。
replace()：构建一个样式表，不允许外部引用。
replaceSync()：构建一个样式表，允许外部引用。

2.3 使用JavaScript访问样式表
访问样式表方式一
应用于文档的所有样式表是通过document.styleSheets集合来表示的。通过这个集合的 length 属性可以获知文档中样式表的数量，而通过方括号语法或 item()方法可以访问每一个样式表。
let sheet = null;
for(let i = 0, len = document.styleSheets.length;i 以上代码可以输出文档中使用的每一个样式表的 href 属性(style元素包含的样式表没有 href 属性)。
访问样式表方式二
还可以通过link或style元素取得CSSStyleSheet对象。DOM 规定了一个包含CSSStyleSheet 对象的属性，名叫sheet。除了 IE，其他浏览器都支持这个属性。IE 支持的是styleSheet属性。
在不同浏览器中都能取得样式表对象：
function getStyleSheet(element){
    return element.sheet || element.styleSheet;
}
//取得第一个元素引入的样式表,如果没有则返回空的HTMLCollection集合
const link = document.getElementsByTagName("link")[0];
if(typeof link === 'object' && link.rel === 'stylesheet') {
 const sheet = getStyleSheet(link);
}

如果link标签不是引入的css样式，则sheet返回null。

1.1.3. 第三部分：CSSRule规则类型接口介绍
CSSRule对象表示样式表中的每一条规则。实际上，CSSRule是一个供其他多种类型继承的基类 型，其中最常见的就是CSSStyleRule类型，表示样式信息(其他规则还有@import、@font-face、 @page和@charset，但这些规则很少有必要通过脚本来访问)。CSSStyleRule 对象包含下列属性。

cssText：返回整条规则对应的文本。由于浏览器对样式表的内部处理方式不同，返回的文本 可能会与样式表中实际的文本不一样;Safari 始终都会将文本转换成全部小写。IE 不支持这个 属性。
parentRule：如果当前规则是导入的规则，这个属性引用的就是导入规则;否则，这个值为 null。IE 不支持这个属性。
parentStyleSheet：当前规则所属的样式表。IE 不支持这个属性。
selectorText：返回当前规则的选择符文本。
style：一个CSSStyleDeclaration对象，可以通过它设置和取得规则中特定的样式值。
type：表示规则类型的常量值。对于样式规则，这个值是 1。IE 不支持这个属性。
styleMap：一个StylePropertyMap对象。StylePropertyMap对象提供了 CSS 声明块的表示，该声明块可以替代CSSStyleDeclaration。


CSSStyleRule对象的cssText属性与style.cssText属性类似，但并不相同。前者包含选择符文本和围绕样式信息的花括号，后者只包含样式信息(类似于 元素的 style.cssText)。此外，cssText 是只读的，而 style.cssText 也可以被重写。

下面是获取各个属性显示的结果：

  .demo {
    background-color: blue;
    width: 100px;
    height: 200px;
  }



  var sheet = document.styleSheets[0];
  var rules = sheet.cssRules || sheet.rules;
  var rule = rules[0];
  console.log(rule.selectorText);           //.demo
  console.log(rule.style.backgroundColor);  //blue
  console.log(rule.style.width);            //100px
  console.log(rule.style.height);           //200px
  //.demo { background-color: blue; width: 100px; height: 200px; }
  console.log(rule.cssText);
  //background-color: blue; width: 100px; height: 200px;
  console.log(rule.style.cssText);

使用rule.style这种方式，可以像确定元素的行内样式信息一样，确定与规则相关的样式信息。与使用元素的方式一样，在这种方式下也可以修改样式信息，如下面的例子：
var sheet = document.styleSheets[0];
var rules = sheet.cssRules || sheet.rules;
var rule = rules[0];
rule.style.backgroundColor = "red";
以上面这种方式修改规则会影响页面中适用于该规则的所有元素。换句话说，如果有两个带有demo类的div元素，那么这两个元素都会应用修改后的样式。
3.1 创建规则和删除规则(CSSStyleSheet接口的方法)
创建规则
DOM 规定，要向现有样式表中添加新规则，需要使用insertRule()方法。这个方法接受两个参 数：规则文本和表示在哪里插入规则的索引。
var sheet = document.styleSheets[0];
sheet.insertRule("body { background-color: silver }", 0); //IE不支持
IE8 及更早版本支持一个类似的方法，名叫 addRule()
sheet.addRule("body", "background-color: silver", 0); //仅对 IE 有效
以跨浏览器的方式向样式表中插入规则：
//insertRule(document.styleSheets[0], "body", "background-color: silver", 0);
function insertRule(sheet, selectorText, cssText, position){
    if (sheet.insertRule){
        sheet.insertRule(selectorText + "{" + cssText + "}", position);
    } elseif (sheet.addRule){
      sheet.addRule(selectorText, cssText, position);
  }
}

上面这个例子插入的规则会改变元素的背景颜色。插入的规则将成为样式表中的第一条规则(插入到了 位置 0)——规则的次序在确定层叠之后应用到文档的规则时至关重要。

删除规则
从样式表中删除规则的方法是 deleteRule()，这个方法接受一个参数:要删除的规则的位置。例 如，要删除样式表中的第一条规则。
sheet.deleteRule(0);
IE 支持的类似方法叫 removeRule()：
sheet.removeRule(0); //仅对 IE 有效
以跨浏览器的方式向样式表中删除规则：
//deleteRule(document.styleSheets[0], 0);
function deleteRule(sheet, index){
    if (sheet.deleteRule){
        sheet.deleteRule(index);
    } elseif (sheet.removeRule){
        sheet.removeRule(index);
    }
}

添加规则和删除规则在实际 Web 开发中并不常用，慎重使用。

