Blob是现代浏览器中提供的能够装载二进制流（文件）的容器对象。
ArrayBuffer是能够装载Blob（二进制流）数据的原始缓冲区，ArrayBuffer不能直接通过 js 读写。
TypeArray是ArrayBuffer的一种类数组的视图对象，可以将ArrayBuffer按不同字节数读取成类似数组形式的数据类型，从而可以向读写数组元素一样，实现对ArrayBuffer数据的读写。常见的TypeArray包括Uint8Array,Uint16Array,Uint32Array等。点这里查看所有的 TypedArray

所以我对三者的理解是： Blob  ArrayBuffer  TypeArray  Array
由于TypeArray和Array有些相似，因此往往我会选择在TypeArray这层做处理。
下面是TypeArray、ArrayBuffer和Blob之间相互转换的方法。
