var bl = new Blob(); // bl是要转换的blob
var fr = new FileReader();
fr.onload = function() {
  var ab = this.result; // ab是转换后的结果
};
fr.readAsArrayBuffer(bl);

1.4. ArrayBuffer to Blob （ArrayBuffer 转 Blob）
var ab = new ArrayBuffer(32);
var blob = new Blob([ab]); // 注意必须包裹[]

