Uint8 数组可以直观的看到 ArrayBuffer 中每个字节（1 字节 == 8 位）的值。一般我们要将 ArrayBuffer 转成 Uint 类型数组后才能对其中的字节进行存取操作。
var ab = arrayBuffer; // arrayBuffer为要转换的值
var u8 = new Uint8Array(ab);

