检测对象是否属性某个类 A instanceof B（验证原型对象与实例对象之间的关系 判断具体类型）
Instanceof 的判断队则是：沿着 A 的proto这条线来找,同时沿着 B 的prototype这条线来找,如果两条线能找到同一个引用,即同一个对象,那么就返回 true.如果找到终点还未重合,则返回 false.
