性能优化一直是前端开发的注意点，通常情况下，当前页面跳转到下一个页面，然后再返回，当前页面会重新渲染 DOM 然后再获取数据更新 DOM，在此过程中造成了不必要的资源浪费。正好 vue 中提供了 keep-alive 内置组件，使用 keep-alive 包裹组件，可以把切换出去的组件保留在内存中，从而保留它的状态避免重新渲染，达到了缓存组件的效果。
