1. Java 变量的类型1.1. Java 局部变量1.1.1. 实例11.1.2. 实例 21.2. 实例变量1.2.1. 实例1.3. 类变量（静态变量）1.3.1. 实例1. Java 变量的类型
在Java语言中，所有的变量在使用前必须声明。声明变量的基本格式如下：
type identifier [ = value][, identifier [= value] ...] ;
格式说明：type为Java数据类型。identifier是变量名。可以使用逗号隔开来声明多个同类型变量。
以下列出了一些变量的声明实例。注意有些包含了初始化过程。
int a, b, c;         // 声明三个int型整数：a、 b、c
int d = 3, e = 4, f = 5; // 声明三个整数并赋予初值
byte z = 22;         // 声明并初始化 z
String s = "nowcoder";  // 声明并初始化字符串 s
double pi = 3.14159; // 声明了双精度浮点型变量 pi
char x = 'x';        // 声明变量 x 的值是字符 'x'。
Java语言支持的变量类型有：

类变量：独立于方法之外的变量，用 static 修饰。
实例变量：独立于方法之外的变量，不过没有 static 修饰。
局部变量：类的方法中的变量。

public class Test{

    static int allClicks=0;    // 类变量

    String str = "hello world";  // 实例变量

    public void method() {
        int i = 0;  // 局部变量
    }
}
1.1. Java 局部变量

局部变量声明在方法、构造方法或者语句块中；
局部变量在方法、构造方法、或者语句块被执行的时候创建，当它们执行完成后，变量将会被销毁；  
访问修饰符不能用于局部变量； 
局部变量只在声明它的方法、构造方法或者语句块中可见；
局部变量是在栈上分配的。
局部变量没有默认值，所以局部变量被声明后，必须经过初始化，才可以使用。 

1.1.1. 实例1
在以下实例中age是一个局部变量。定义在pupAge()方法中，它的作用域就限制在这个方法中。
 public class Test{

   public void setAge(){
      int age = 0;
      age = age + 7;
      System.out.println("小狗的年龄是: " + age);
   }

   public static void main(String[] args){
      Test test = new Test();
      test.setAge();
   }
}
以上实例编译运行结果如下:
小狗的年龄是: 7
1.1.2. 实例 2
在下面的例子中 age 变量没有初始化，所以在编译时会出错：
public class Test{

   public void setAge(){
      int age;
      age = age + 7;
      System.out.println("小狗的年龄是 : " + age);
   }

   public static void main(String[] args){
      Test test = new Test();
      test.setAge();
   }

}
以上实例编译运行结果如下:
Test.java:4:variable number might not have been initialized
age = age + 7;
         ^
1 error
1.2. 实例变量

实例变量声明在一个类中，但在方法、构造方法和语句块之外；
当一个对象被实例化之后，每个实例变量的值就跟着确定；
实例变量在对象创建的时候创建，在对象被销毁的时候销毁；
实例变量的值应该至少被一个方法、构造方法或者语句块引用，使得外部能够通过这些方式获取实例变量信息；
实例变量可以声明在使用前或者使用后；
访问修饰符可以修饰实例变量；
实例变量对于类中的方法、构造方法或者语句块是可见的。一般情况下应该把实例变量设为私有。通过使用访问修饰符可以使实例变量对子类可见；
实例变量具有默认值。数值型变量的默认值是0，布尔型变量的默认值是false，引用类型变量的默认值是null。变量的值可以在声明时指定，也可以在构造方法中指定；
实例变量可以直接通过变量名访问。但在静态方法以及其他类中，就应该使用完全限定名：ObejectReference.VariableName。

1.2.1. 实例
public class Employee{

   // 这个实例变量对子类可见
   public String name;
   // 私有变量，仅在该类可见
   private double salary;

   //在构造器中对name赋值
   public Employee (String empName){
      name = empName;
   }

   //设定salary的值
   public void setSalary(double empSal){
      salary = empSal;
   } 

   // 打印信息
   public void printEmp(){
      System.out.println("名字 : " + name );
      System.out.println("薪水 : " + salary);
   }

   public static void main(String[] args){
      Employee emp = new Employee("nowcoder");
      emp.setSalary(1000);
      emp.printEmp();
   }
}
以上实例编译运行结果如下:
名字 : nowcoder
薪水 : 1000.0
1.3. 类变量（静态变量）

类变量也称为静态变量，在类中以 static 关键字声明，但必须在方法之外。
无论一个类创建了多少个对象，类只拥有类变量的一份拷贝。
静态变量除了被声明为常量外很少使用。常量是指声明为public/private，final和static类型的变量。常量初始化后不可改变。
静态变量储存在静态存储区。经常被声明为常量，很少单独使用static声明变量。
静态变量在第一次被访问时创建，在程序结束时销毁。
与实例变量具有相似的可见性。但为了对类的使用者可见，大多数静态变量声明为public类型。
默认值和实例变量相似。数值型变量默认值是0，布尔型默认值是false，引用类型默认值是null。变量的值可以在声明的时候指定，也可以在构造方法中指定。此外，静态变量还可以在静态语句块中初始化。
静态变量可以通过：ClassName.VariableName的方式访问。
类变量被声明为public static final类型时，类变量名称一般建议使用大写字母。如果静态变量不是public和final类型，其命名方式与实例变量以及局部变量的命名方式一致。

1.3.1. 实例
public class Employee {

    //salary是静态的私有变量
    private static double salary;
    // DEPARTMENT是一个常量
    public static final String DEPARTMENT = "高中部";

    public static void main(String[] args){
           salary = 10000;
        System.out.println(DEPARTMENT+"平均工资:"+salary);
    }
}
以上实例编译运行结果如下:
高中部平均工资:10000.0
注意：如果其他类想要访问该变量，可以这样访问：Employee.DEPARTMENT。

Java基础/基本数据类型.html.body:
1. Java 基本数据类型1.1. 基本数据类型1.1.1. 实例1.1.2. 类型默认值1.1.3. 实例1.2. 整型1.3. 浮点型1.4. 布尔类型1.5. 字符类型1.6. 引用类型1.7. 常量1.8. var 关键字1.9. 变量的作用范围1.10. 引用类型1.11. Java 常量1.12. 自动类型转换1.12.1. 强制类型转换1.12.2. 隐含强制类型转换1. Java 基本数据类型
变量就是申请内存来存储值。也就是说，当创建变量的时候，需要在内存中申请空间。
内存管理系统根据变量的类型为变量分配存储空间，分配的空间只能用来储存该类型数据。

因此，通过定义不同类型的变量，可以在内存中储存整数、小数或者字符。
Java 的两大数据类型:

内置数据类型
引用数据类型


在 Java 中，变量必须先定义后使用，在定义变量的时候，可以给它一个初始值。

1.1. 基本数据类型
byte：

byte 数据类型是 8 位、有符号的，以二进制补码表示的整数；
最小值是 -128（-2^7）；
最大值是 127（2^7-1）；
默认值是 0；
byte 类型用在大型数组中节约空间，主要代替整数，因为 byte 变量占用的空间只有 int 类型的四分之一；
例子：byte a = 100，byte b = -50。

short：

short 数据类型是 16 位、有符号的以二进制补码表示的整数
最小值是 -32768（-2^15）；
最大值是 32767（2^15 - 1）；
Short 数据类型也可以像 byte 那样节省空间。一个 short 变量是 int 型变量所占空间的二分之一；
默认值是 0；
例子：short s = 1000，short r = -20000。

int：

int 数据类型是 32 位、有符号的以二进制补码表示的整数；
最小值是 -2,147,483,648（-2^31）；
最大值是 2,147,483,647（2^31 - 1）；
一般地整型变量默认为 int 类型；
默认值是 0 ；
例子：int a = 100000, int b = -200000。

long：

long 数据类型是 64 位、有符号的以二进制补码表示的整数；
最小值是 -9,223,372,036,854,775,808（-2^63）；
最大值是 9,223,372,036,854,775,807（2^63 -1）；
这种类型主要使用在需要比较大整数的系统上；
默认值是 0L；
例子： long a = 100000L，Long b = -200000L。
"L"理论上不分大小写，但是若写成"l"容易与数字"1"混淆，不容易分辩。所以最好大写。

float：

float 数据类型是单精度、32 位、符合 IEEE 754 标准的浮点数；
float 在储存大型浮点数组的时候可节省内存空间；
默认值是 0.0f；
浮点数不能用来表示精确的值，如货币；
例子：float f1 = 234.5f。

double：

double 数据类型是双精度、64 位、符合 IEEE 754 标准的浮点数；
浮点数的默认类型为 double 类型；
double 类型同样不能表示精确的值，如货币；
默认值是 0.0d；
例子：double d1 = 123.4。

boolean：

boolean 数据类型表示一位的信息；
只有两个取值：true 和 false；
这种类型只作为一种标志来记录 true/false 情况；
默认值是 false；
例子：boolean one = true。

char：

char 类型是一个单一的 16 位 Unicode 字符；
最小值是 \u0000（即为 0）；
最大值是 \uffff（即为 65,535）；
char 数据类型可以储存任何字符；
例子：char letter = 'A';。

计算机内存的最小存储单元是字节（byte），一个字节就是一个 8 位二进制数，即 8 个 bit。它的二进制表示范围从 00000000~11111111，换算成十进制是 0~255，换算成十六进制是 00~ff。
内存单元从 0 开始编号，称为内存地址。每个内存单元可以看作一间房间，内存地址就是门牌号。

一个字节是 1byte，1024 字节是 1K，1024K 是 1M，1024M 是 1G，1024G 是 1T。一个拥有 4T 内存的计算机的字节数量就是：
4T = 4 x 1024G
   = 4 x 1024 x 1024M
   = 4 x 1024 x 1024 x 1024K
   = 4 x 1024 x 1024 x 1024 x 1024
   = 4398046511104

byte 恰好就是一个字节，而 long 和 double 需要 8 个字节。
1.1.1. 实例
对于数值类型的基本类型的取值范围，我们无需强制去记忆，因为它们的值都已经以常量的形式定义在对应的包装类中了。请看下面的例子：
public class Test {

   public static void main(String[] args) {
       // byte
       System.out.println("基本类型：byte 二进制位数：" + Byte.SIZE);
       System.out.println("包装类：java.lang.Byte");
       System.out.println("最小值：Byte.MIN_VALUE=" + Byte.MIN_VALUE);
       System.out.println("最大值：Byte.MAX_VALUE=" + Byte.MAX_VALUE);
       System.out.println();

       // short
       System.out.println("基本类型：short 二进制位数：" + Short.SIZE);
       System.out.println("包装类：java.lang.Short");
       System.out.println("最小值：Short.MIN_VALUE=" + Short.MIN_VALUE);
       System.out.println("最大值：Short.MAX_VALUE=" + Short.MAX_VALUE);
       System.out.println();

       // int
       System.out.println("基本类型：int 二进制位数：" + Integer.SIZE);
       System.out.println("包装类：java.lang.Integer");
       System.out.println("最小值：Integer.MIN_VALUE=" + Integer.MIN_VALUE);
       System.out.println("最大值：Integer.MAX_VALUE=" + Integer.MAX_VALUE);
       System.out.println();

       // long
       System.out.println("基本类型：long 二进制位数：" + Long.SIZE);
       System.out.println("包装类：java.lang.Long");
       System.out.println("最小值：Long.MIN_VALUE=" + Long.MIN_VALUE);
       System.out.println("最大值：Long.MAX_VALUE=" + Long.MAX_VALUE);
       System.out.println();

       // float
       System.out.println("基本类型：float 二进制位数：" + Float.SIZE);
       System.out.println("包装类：java.lang.Float");
       System.out.println("最小值：Float.MIN_VALUE=" + Float.MIN_VALUE);
       System.out.println("最大值：Float.MAX_VALUE=" + Float.MAX_VALUE);
       System.out.println();

       // double
       System.out.println("基本类型：double 二进制位数：" + Double.SIZE);
       System.out.println("包装类：java.lang.Double");
       System.out.println("最小值：Double.MIN_VALUE=" + Double.MIN_VALUE);
       System.out.println("最大值：Double.MAX_VALUE=" + Double.MAX_VALUE);
       System.out.println();

       // char
       System.out.println("基本类型：char 二进制位数：" + Character.SIZE);
       System.out.println("包装类：java.lang.Character");
       // 以数值形式而不是字符形式将Character.MIN_VALUE输出到控制台
       System.out.println("最小值：Character.MIN_VALUE="
               + (int) Character.MIN_VALUE);
       // 以数值形式而不是字符形式将Character.MAX_VALUE输出到控制台
       System.out.println("最大值：Character.MAX_VALUE="
               + (int) Character.MAX_VALUE);
   }

}
编译并运行以上代码，输出结果如下所示：
基本类型：byte 二进制位数：8
包装类：java.lang.Byte
最小值：Byte.MIN_VALUE=-128
最大值：Byte.MAX_VALUE=127

基本类型：short 二进制位数：16
包装类：java.lang.Short
最小值：Short.MIN_VALUE=-32768
最大值：Short.MAX_VALUE=32767

基本类型：int 二进制位数：32
包装类：java.lang.Integer
最小值：Integer.MIN_VALUE=-2147483648
最大值：Integer.MAX_VALUE=2147483647

基本类型：long 二进制位数：64
包装类：java.lang.Long
最小值：Long.MIN_VALUE=-9223372036854775808
最大值：Long.MAX_VALUE=9223372036854775807

基本类型：float 二进制位数：32
包装类：java.lang.Float
最小值：Float.MIN_VALUE=1.4E-45
最大值：Float.MAX_VALUE=3.4028235E38

基本类型：double 二进制位数：64
包装类：java.lang.Double
最小值：Double.MIN_VALUE=4.9E-324
最大值：Double.MAX_VALUE=1.7976931348623157E308

基本类型：char 二进制位数：16
包装类：java.lang.Character
最小值：Character.MIN_VALUE=0
最大值：Character.MAX_VALUE=65535
Float 和 Double 的最小值和最大值都是以科学记数法的形式输出的，结尾的"E+数字"表示 E 之前的数字要乘以 10 的多少次方。比如 3.14E3 就是 3.14 × 103 =3140，3.14E-3 就是 3.14 x 10-3 =0.00314。
实际上，JAVA 中还存在另外一种基本类型 void，它也有对应的包装类 java.lang.Void，不过我们无法直接对它们进行操作。
1.1.2. 类型默认值
下表列出了 Java 各个类型的默认值：
    **数据类型** **默认值**    byte 0   short 0   int 0   long 0L   float 0.0f   double 0.0d   char 'u0000'   String (or any object) null   boolean false  

1.1.3. 实例
public class Test {

    static boolean bool;
    static byte by;
    static char ch;
    static double d;
    static float f;
    static int i;
    static long l;
    static short sh;
    static String str;

    public static void main(String[] args) {
        System.out.println("Bool :" + bool);
        System.out.println("Byte :" + by);
        System.out.println("Character:" + ch);
        System.out.println("Double :" + d);
        System.out.println("Float :" + f);
        System.out.println("Integer :" + i);
        System.out.println("Long :" + l);
        System.out.println("Short :" + sh);
        System.out.println("String :" + str);
    }

}
实例输出结果为：
Bool     :false
Byte     :0
Character:
Double   :0.0
Float    :0.0
Integer  :0
Long     :0
Short    :0
String   :null
1.2. 整型
对于整型类型，Java 只定义了带符号的整型，因此，最高位的 bit 表示符号位（0 表示正数，1 表示负数）。各种整型能表示的最大范围如下

byte：-128 ~ 127
short: -32768 ~ 32767
int: -2147483648 ~ 2147483647
long: -9223372036854775808 ~ 9223372036854775807

public class Main {
    public static void main(String[] args) {
        int i = 2147483647;
        int i2 = -2147483648;
        int i3 = 2_000_000_000; // 加下划线更容易识别
        int i4 = 0xff0000; // 十六进制表示的16711680
        int i5 = 0b1000000000; // 二进制表示的512
        long l = 9000000000000000000L; // long型的结尾需要加L
    }
}

同一个数的不同进制的表示是完全相同的，例如 15=0xf ＝ 0b1111

1.3. 浮点型
浮点类型的数就是小数，因为小数用科学计数法表示的时候，小数点是可以“浮动”的，如 1234.5 可以表示成 12.345x102，也可以表示成 1.2345x103，所以称为浮点数。
float f1 = 3.14f;
float f2 = 3.14e38f; // 科学计数法表示的3.14x10^38
double d = 1.79e308;
double d2 = -1.79e308;
double d3 = 4.9e-324; // 科学计数法表示的4.9x10^-324

对于 float 类型，需要加上 f 后缀。

浮点数可表示的范围非常大，float 类型可最大表示 3.4x1038，而 double 类型可最大表示 1.79x10308。
1.4. 布尔类型
布尔类型 boolean 只有 true 和 false 两个值，布尔类型总是关系运算的计算结果
boolean b1 = true;
boolean b2 = false;
boolean isGreater = 5 > 3; // 计算结果为true
int age = 12;
boolean isAdult = age >= 18; // 计算结果为false
Java 语言对布尔类型的存储并没有做规定，因为理论上存储布尔类型只需要 1 bit，但是通常 JVM 内部会把 boolean 表示为 4 字节整数
1.5. 字符类型
字符类型 char 表示一个字符。Java 的 char 类型除了可表示标准的 ASCII 外，还可以表示一个 Unicode 字符：
public class Main {
    public static void main(String[] args) {
        char a = 'A';
        char zh = '中';
        System.out.println(a);
        System.out.println(zh);
    }
}

注意 char 类型使用单引号'，且仅有一个字符，要和双引号"的字符串类型区分开。

1.6. 引用类型

在 Java 中，引用类型的变量非常类似于 C/C++的指针。引用类型指向一个对象，指向对象的变量是引用变量。这些变量在声明时被指定为一个特定的类型，比如 Employee、Puppy 等。变量一旦声明后，类型就不能被改变了。
对象、数组都是引用数据类型。
所有引用类型的默认值都是 null。
一个引用变量可以用来引用任何与之兼容的类型。
例子：Site site = new Site("Runoob")。

1.7. 常量
定义变量的时候，如果加上 final 修饰符，这个变量就变成了常量：
final double PI = 3.14; // PI是一个常量
double r = 5.0;
double area = PI * r * r;
PI = 300; // compile error!
常量在定义时进行初始化后就不可再次赋值，再次赋值会导致编译错误。
常量的作用是用有意义的变量名来避免魔术数字（Magic number），例如，不要在代码中到处写 3.14，而是定义一个常量。如果将来需要提高计算精度，我们只需要在常量的定义处修改，例如，改成 3.1416，而不必在所有地方替换 3.14。
根据习惯，常量名通常全部大写。
1.8. var 关键字
有些时候，类型的名字太长，写起来比较麻烦。例如：
StringBuilder sb = new StringBuilder();
这个时候，如果想省略变量类型，可以使用 var 关键字：
var sb = new StringBuilder();
编译器会根据赋值语句自动推断出变量 sb 的类型是 StringBuilder。对编译器来说，语句：
var sb = new StringBuilder();
实际上会自动变成：
StringBuilder sb = new StringBuilder();
因此，使用 var 定义变量，仅仅是少写了变量类型而已。
1.9. 变量的作用范围
在 Java 中，多行语句用{ }括起来。很多控制语句，例如条件判断和循环，都以{ }作为它们自身的范围，例如：
if (...) { // if开始
    ...
    while (...) { while 开始
        ...
        if (...) { // if开始
            ...
        } // if结束
        ...
    } // while结束
    ...
} // if结束
只要正确地嵌套这些{ }，编译器就能识别出语句块的开始和结束。而在语句块中定义的变量，它有一个作用域，就是从定义处开始，到语句块结束。超出了作用域引用这些变量，编译器会报错。举个例子：
{
    ...
    int i = 0; // 变量i从这里开始定义
    ...
    {
        ...
        int x = 1; // 变量x从这里开始定义
        ...
        {
            ...
            String s = "hello"; // 变量s从这里开始定义
            ...
        } // 变量s作用域到此结束
        ...
        // 注意，这是一个新的变量s，它和上面的变量同名，
        // 但是因为作用域不同，它们是两个不同的变量:
        String s = "hi";
        ...
    } // 变量x和s作用域到此结束
    ...
} // 变量i作用域到此结束

定义变量时，要遵循作用域最小化原则，尽量将变量定义在尽可能小的作用域，并且，不要重复使用变量名。

1.10. 引用类型

在 Java 中，引用类型的变量非常类似于 C/C++的指针。引用类型指向一个对象，指向对象的变量是引用变量。这些变量在声明时被指定为一个特定的类型，比如 Employee、Puppy 等。变量一旦声明后，类型就不能被改变了。 对象、数组都是引用数据类型。 所有引用类型的默认值都是 null。 一个引用变量可以用来引用任何与之兼容的类型。 例子：Site site = new Site("Nowcoder")。

1.11. Java 常量
常量在程序运行时是不能被修改的。
在 Java 中使用 final 关键字来修饰常量，声明方式和变量类似：
final double PI = 3.1415927;
虽然常量名也可以用小写，但为了便于识别，通常使用大写字母表示常量。
字面量可以赋给任何内置类型的变量。例如：
byte a = 68;
char a = 'A'
byte、int、long、和 short 都可以用十进制、16 进制以及 8 进制的方式来表示。
当使用常量的时候，前缀 0 表示 8 进制，而前缀 0x 代表 16 进制, 例如：
int decimal = 100;
int octal = 0144;
int hexa =  0x64;
和其他语言一样，Java 的字符串常量也是包含在两个引号之间的字符序列。下面是字符串型字面量的例子：
"Hello World"
"two\nlines"
"\"This is in quotes\""
字符串常量和字符常量都可以包含任何 Unicode 字符。例如：
char a = '\u0001';
String a = "\u0001";
Java 语言支持一些特殊的转义字符序列。
    符号 字符含义    \n 换行 (0x0a)   \r 回车 (0x0d)   \f 换页符(0x0c)   \b 退格 (0x08)   \0 空字符 (0x20)   \s 字符串   \t 制表符   " 双引号   ' 单引号   \ 反斜杠   \ddd 八进制字符 (ddd)   \uxxxx 16进制Unicode字符 (xxxx)  

1.12. 自动类型转换
整型、实型（常量）、字符型数据可以混合运算。运算中，不同类型的数据先转化为同一类型，然后进行运算。
转换从低级到高级。
低  ------------------------------------>  高

byte,short,char—> int —> long—> float —> double
数据类型转换必须满足如下规则：

不能对 boolean 类型进行类型转换。
不能把对象类型转换成不相关类的对象。
在把容量大的类型转换为容量小的类型时必须使用强制类型转换。
转换过程中可能导致溢出或损失精度，例如：

int i = 128;
byte b = (byte)i;
​ 因为 byte 类型是 8 位，最大值为 127，所以当 int 强制转换为 byte 类型时，值 128 时候就会导致溢出。

浮点数到整数的转换是通过舍弃小数得到，而不是四舍五入，例如：

(int)23.7 == 23;
(int)-45.89f == -45
必须满足转换前的数据类型的位数要低于转换后的数据类型，例如: short 数据类型的位数为 16 位，就可以自动转换位数为 32 的 int 类型，同样 float 数据类型的位数为 32，可以自动转换为 64 位的 double 类型。
public class Test{

        public static void main(String[] args){
            char c1='a'; //定义一个char类型
            int i1 = c1; //char自动类型转换为int
            System.out.println("char自动类型转换为int后的值等于" + i1);
            char c2 = 'A'; //定义一个char类型
            int i2 = c2 + 1; //char 类型和 int 类型计算
            System.out.println("char类型和int计算后的值等于" + i2);
        }

}
运行结果为:
char自动类型转换为int后的值等于97
char类型和int计算后的值等于66
解析：c1 的值为字符 a ,查 ASCII 码表可知对应的 int 类型值为 97， A 对应值为 65，所以 i2=65+1=66。
1.12.1. 强制类型转换

条件是转换的数据类型必须是兼容的。
(type) value type 是要强制类型转换后的数据类型 实例：

public class Test{

   public static void main(String[] args){
       int i1 = 123;
       byte b = (byte) i1; //强制类型转换为byte
       System.out.println("int强制类型转换为byte后的值等于" + b);
   }

}
1.12.2. 隐含强制类型转换

整数的默认类型是 int。
浮点型不存在这种情况，因为在定义 float 类型时必须在数字后面跟上 F 或者 f。

Java基础/修饰符.html.body:
1. Java 修饰符1.1. 访问控制修饰符1.1.1. 默认访问修饰符-不使用任何关键字1.1.2. 私有访问修饰符-private1.1.3. 公有访问修饰符-public1.1.4. 受保护的访问修饰符-protected1.1.5. 访问控制和继承1.2. 非访问修饰符1.2.1. static 修饰符1.2.2. final 修饰符1.2.3. abstract 修饰符1.2.4. synchronized 修饰符1.2.5. transient 修饰符1.2.6. volatile 修饰符1. Java 修饰符
Java语言提供了很多修饰符，主要分为以下两类：

访问修饰符*   非访问修饰符 

修饰符用来定义类、方法或者变量，通常放在语句的最前端。
1.1. 访问控制修饰符
Java中，可以使用访问控制符来保护对类、变量、方法和构造方法的访问。Java 支持 4 种不同的访问权限。

default (即默认，什么也不写）: 在同一包内可见，不使用任何修饰符。使用对象：类、接口、变量、方法。
private : 在同一类内可见。使用对象：变量、方法。 注意：不能修饰类（外部类）
public : 对所有类可见。使用对象：类、接口、变量、方法
protected : 对同一包内的类和所有子类可见。使用对象：变量、方法。 注意：不能修饰类（外部类）。 

我们可以通过以下表来说明访问权限：
    修饰符 当前类 同一包内 子孙类(同一包) 子孙类(不同包) 其他包    `public` Y Y Y Y Y   `protected` Y Y Y Y/N N   `default` Y Y Y N N   `private` Y N N N N   
1.1.1. 默认访问修饰符-不使用任何关键字
使用默认访问修饰符声明的变量和方法，对同一个包内的类是可见的。接口里的变量都隐式声明为 public static final,而接口里的方法默认情况下访问权限为 public。
如下例所示，变量和方法的声明可以不使用任何修饰符。
String version = "1.5.1";
boolean processOrder() {
   return true;
}
1.1.2. 私有访问修饰符-private
私有访问修饰符是最严格的访问级别，所以被声明为 private 的方法、变量和构造方法只能被所属类访问，并且类和接口不能声明为 private。
声明为私有访问类型的变量只能通过类中公共的 getter 方法被外部类访问。
Private 访问修饰符的使用主要用来隐藏类的实现细节和保护类的数据。
下面的类使用了私有访问修饰符：
public class Logger {
   private String format;
   public String getFormat() {
      return this.format;
   }
   public void setFormat(String format) {
      this.format = format;
   }
}
实例中，Logger 类中的 format 变量为私有变量，所以其他类不能直接得到和设置该变量的值。为了使其他类能够操作该变量，定义了两个 public 方法：getFormat() （返回 format的值）和 setFormat(String)（设置 format 的值）
1.1.3. 公有访问修饰符-public
被声明为 public 的类、方法、构造方法和接口能够被任何其他类访问。
如果几个相互访问的 public 类分布在不同的包中，则需要导入相应 public 类所在的包。由于类的继承性，类所有的公有方法和变量都能被其子类继承。
以下函数使用了公有访问控制：
public static void main(String[] arguments) {
   // ...
}
Java 程序的 main() 方法必须设置成公有的，否则，Java 解释器将不能运行该类。
1.1.4. 受保护的访问修饰符-protected
protected 需要从以下两个点来分析说明：

子类与基类在同一包中：被声明为 protected 的变量、方法和构造器能被同一个包中的任何其他类访问；
子类与基类不在同一包中：那么在子类中，子类实例可以访问其从基类继承而来的 protected 方法，而不能访问基类实例的protected方法。 

protected 可以修饰数据成员，构造方法，方法成员，不能修饰类（内部类除外）。
子类能访问 protected 修饰符声明的方法和变量，这样就能保护不相关的类使用这些方法和变量。
下面的父类使用了 protected 访问修饰符，子类重写了父类的 openSpeaker() 方法。
class AudioPlayer {
   protected boolean openSpeaker(Speaker sp) {
      // 实现细节
   }
}

class StreamingAudioPlayer extends AudioPlayer {
   protected boolean openSpeaker(Speaker sp) {
      // 实现细节
   }
}
如果把 openSpeaker() 方法声明为 private，那么除了 AudioPlayer 之外的类将不能访问该方法。
如果把 openSpeaker() 声明为 public，那么所有的类都能够访问该方法。
如果我们只想让该方法对其所在类的子类可见，则将该方法声明为 protected。
1.1.5. 访问控制和继承
请注意以下方法继承的规则：

父类中声明为 public 的方法在子类中也必须为 public。
父类中声明为 protected 的方法在子类中要么声明为 protected，要么声明为 public，不能声明为 private。
父类中声明为 private 的方法，不能够被继承。 

1.2. 非访问修饰符
为了实现一些其他的功能，Java 也提供了许多非访问修饰符。
static 修饰符，用来修饰类方法和类变量。
final 修饰符，用来修饰类、方法和变量，final 修饰的类不能够被继承，修饰的方法不能被继承类重新定义，修饰的变量为常量，是不可修改的。
abstract 修饰符，用来创建抽象类和抽象方法。
synchronized 和 volatile 修饰符，主要用于线程的编程。
1.2.1. static 修饰符

静态变量：
static 关键字用来声明独立于对象的静态变量，无论一个类实例化多少对象，它的静态变量只有一份拷贝。 静态变量也被称为类变量。局部变量不能被声明为 static 变量。

静态方法：
static 关键字用来声明独立于对象的静态方法。静态方法不能使用类的非静态变量。静态方法从参数列表得到数据，然后计算这些数据。 


对类变量和方法的访问可以直接使用 classname.variablename 和 classname.methodname 的方式访问。
如下例所示，static修饰符用来创建类方法和类变量。
public class InstanceCounter {
   private static int numInstances = 0;
   protected static int getCount() {
      return numInstances;
   }

   private static void addInstance() {
      numInstances++;
   }

   InstanceCounter() {
      InstanceCounter.addInstance();
   }

   public static void main(String[] arguments) {
      System.out.println("Starting with " +
      InstanceCounter.getCount() + " instances");
      for (int i = 0; i 以上实例运行编辑结果如下:
Starting with 0 instances
Created 500 instances
1.2.2. final 修饰符
final 变量：
final 表示"最后的、最终的"含义，变量一旦赋值后，不能被重新赋值。被 final 修饰的实例变量必须显式指定初始值。
final 修饰符通常和 static 修饰符一起使用来创建类常量。
public class Test{
  final int value = 10;
  // 下面是声明常量的实例
  public static final int BOXWIDTH = 6;
  static final String TITLE = "Manager";

  public void changeValue(){
     value = 12; //将输出一个错误
  }
}
final 方法
父类中的 final 方法可以被子类继承，但是不能被之类重写。
声明 final 方法的主要目的是防止该方法的内容被修改。
如下所示，使用 final 修饰符声明方法。
public class Test{
    public final void changeName(){
       // 方法体
    }
}
final 类
final 类不能被继承，没有类能够继承 final 类的任何特性。
public final class Test {
   // 类体
}
1.2.3. abstract 修饰符
抽象类：
抽象类不能用来实例化对象，声明抽象类的唯一目的是为了将来对该类进行扩充。
一个类不能同时被 abstract 和 final 修饰。如果一个类包含抽象方法，那么该类一定要声明为抽象类，否则将出现编译错误。
抽象类可以包含抽象方法和非抽象方法。
abstract class Caravan{
   private double price;
   private String model;
   private String year;
   public abstract void goFast(); //抽象方法
   public abstract void changeColor();
}
抽象方法
抽象方法是一种没有任何实现的方法，该方法的的具体实现由子类提供。
抽象方法不能被声明成 final 和 static。
任何继承抽象类的子类必须实现父类的所有抽象方法，除非该子类也是抽象类。
如果一个类包含若干个抽象方法，那么该类必须声明为抽象类。抽象类可以不包含抽象方法。
抽象方法的声明以分号结尾，例如：public abstract sample();。
public abstract class SuperClass{
    abstract void m(); //抽象方法
}

class SubClass extends SuperClass{
     //实现抽象方法
      void m(){
          .........
      }
}
1.2.4. synchronized 修饰符
synchronized 关键字声明的方法同一时间只能被一个线程访问。synchronized 修饰符可以应用于四个访问修饰符。
public synchronized void showDetails(){
    .......
}
1.2.5. transient 修饰符
序列化的对象包含被 transient 修饰的实例变量时，java 虚拟机(JVM)跳过该特定的变量。
该修饰符包含在定义变量的语句中，用来预处理类和变量的数据类型。
public transient int limit = 55;   // 不会持久化
public int b; // 持久化
1.2.6. volatile 修饰符
volatile 修饰的成员变量在每次被线程访问时，都强制从共享内存中重新读取该成员变量的值。而且，当成员变量发生变化时，会强制线程将变化值回写到共享内存。这样在任何时刻，两个不同的线程总是看到某个成员变量的同一个值。一个 volatile 对象引用可能是 null。
public class MyRunnable implements Runnable
{
    private volatile boolean active;
    public void run() {
        active = true;
        while (active) { // 第一行
            // 代码
        }
    }
    public void stop() {
        active = false; // 第二行
    }
}
通常情况下，在一个线程调用 run() 方法（在 Runnable 开启的线程），在另一个线程调用 stop() 方法。 如果 第一行 中缓冲区的 active 值被使用，那么在 第二行 的 active 值为 false 时循环不会停止。
但是以上代码中我们使用了 volatile 修饰 active，所以该循环会停止。

Java基础/运算符.html.body:
1. Java 运算符1.1. 算术运算符1.1.1. 实例1.1.2. 自增自减运算符1.2. 关系运算符1.3. 位运算符1.4. 逻辑运算符1.4.1. 短路逻辑运算符1.5. 赋值运算符1.6. 条件运算符（?:）1.6.1. 实例1.7. instanceof 运算符1.8. Java运算符优先级1. Java 运算符
计算机的最基本用途之一就是执行数学运算，作为一门计算机语言，Java也提供了一套丰富的运算符来操纵变量。我们可以把运算符分成以下几组：

算术运算符
关系运算符
位运算符
逻辑运算符
赋值运算符
其他运算符

1.1. 算术运算符
算术运算符用在数学表达式中，它们的作用和在数学中的作用一样。下表列出了所有的算术运算符。
表格中的实例假设整数变量A的值为10，变量B的值为20：
    操作符 描述 例子    + 加法 - 相加运算符两侧的值 A + B 等于 30   - 减法 - 左操作数减去右操作数 A – B 等于 -10   * 乘法 - 相乘操作符两侧的值 A * B等于200   / 除法 - 左操作数除以右操作数 B / A等于2   ％ 取余 - 左操作数除以右操作数的余数 B%A等于0   ++ 自增: 操作数的值增加1 B++ 或 ++B 等于 21（区别详见下文）   -- 自减: 操作数的值减少1 B-- 或 --B 等于 19（区别详见下文）   

1.1.1. 实例
下面的简单示例程序演示了算术运算符。复制并粘贴下面的 Java 程序并保存为 Test.java 文件，然后编译并运行这个程序：
public class Test {

  public static void main(String[] args) {
     int a = 10;
     int b = 20;
     int c = 25;
     int d = 25;
     System.out.println("a + b = " + (a + b) );
     System.out.println("a - b = " + (a - b) );
     System.out.println("a * b = " + (a * b) );
     System.out.println("b / a = " + (b / a) );
     System.out.println("b % a = " + (b % a) );
     System.out.println("c % a = " + (c % a) );
     System.out.println("a++   = " +  (a++) );
     System.out.println("a--   = " +  (a--) );
     // 查看  d++ 与 ++d 的不同
     System.out.println("d++   = " +  (d++) );
     System.out.println("++d   = " +  (++d) );
  }
}
以上实例编译运行结果如下：
a + b = 30
a - b = -10
a * b = 200
b / a = 2
b % a = 0
c % a = 5
a++   = 10
a--   = 11
d++   = 25
++d   = 27
1.1.2. 自增自减运算符
1、自增（++）自减（--）运算符是一种特殊的算术运算符，在算术运算符中需要两个操作数来进行运算，而自增自减运算符是一个操作数。
public class Test{
    public static void main(String[] args){
        int a = 3;//定义一个变量；
        int b = ++a;//自增运算
        int c = 3;
        int d = --c;//自减运算
        System.out.println("进行自增运算后的值等于"+b);
        System.out.println("进行自减运算后的值等于"+d);
    }
}
运行结果为：
进行自增运算后的值等于4
进行自减运算后的值等于2
解析：

int b = ++a; 拆分运算过程为: a=a+1=4; b=a=4, 最后结果为b=4,a=4
int d = --c; 拆分运算过程为: c=c-1=2; d=c=2, 最后结果为d=2,c=2 

2、前缀自增自减法(++a,--a): 先进行自增或者自减运算，再进行表达式运算。
3、后缀自增自减法(a++,a--): 先进行表达式运算，再进行自增或者自减运算 实例：
public class Test{
    public static void main(String[] args){
        int a = 5;//定义一个变量；
        int b = 5;
        int x = 2*++a;
        int y = 2*b++;
        System.out.println("自增运算符前缀运算后a="+a+",x="+x);
        System.out.println("自增运算符后缀运算后b="+b+",y="+y);
    }
}
运行结果为：
自增运算符前缀运算后a=6，x=12
自增运算符后缀运算后b=6，y=10
1.2. 关系运算符
下表为Java支持的关系运算符
表格中的实例整数变量A的值为10，变量B的值为20：
