String 类是不可改变的，所以你一旦创建了 String 对象，那它的值就无法改变了.如果需要对字符串做很多修改，那么应该选择使用 StringBuffer & StringBuilder 类。

1.2. 字符串长度
String 类的一个访问器方法是 length() 方法，它返回字符串对象包含的字符数。
public class Main {
    public static void main(String[] args) {
        method2();
