1. Java 流(Stream)、文件(File)和IO1.1. 读取控制台输入1.2. 从控制台读取多字符输入1.3. BRRead.java 文件代码：1.4. 从控制台读取字符串1.5. BRReadLines.java 文件代码：1.6. 控制台输出1.6.1. 实例1.7. WriteDemo.java 文件代码：1.8. 读写文件1.9. FileInputStream1.10. FileOutputStream1.10.1. 实例1.11. fileStreamTest.java 文件代码：1.12. fileStreamTest2.java 文件代码：1.13. 文件和I/O1.14. Java中的目录1.14.1. 创建目录：1.15. CreateDir.java 文件代码：1.16. 读取目录1.17. DirList.java 文件代码：1.18. 删除目录或文件1.19. DeleteFileDemo.java 文件代码：1. Java 流(Stream)、文件(File)和IO
Java.io 包几乎包含了所有操作输入、输出需要的类。所有这些流类代表了输入源和输出目标。
Java.io 包中的流支持很多种格式，比如：基本类型、对象、本地化字符集等等。
一个流可以理解为一个数据的序列。输入流表示从一个源读取数据，输出流表示向一个目标写数据。
Java 为 I/O 提供了强大的而灵活的支持，使其更广泛地应用到文件传输和网络编程中。
但本节讲述最基本的和流与 I/O 相关的功能。我们将通过一个个例子来学习这些功能。

1.1. 读取控制台输入
Java 的控制台输入由 System.in 完成。
为了获得一个绑定到控制台的字符流，你可以把 System.in 包装在一个 BufferedReader 对象中来创建一个字符流。
下面是创建 BufferedReader 的基本语法：
BufferedReader br = new BufferedReader(new 
                      InputStreamReader(System.in));
BufferedReader 对象创建后，我们便可以使用 read() 方法从控制台读取一个字符，或者用 readLine() 方法读取一个字符串。

1.2. 从控制台读取多字符输入
从 BufferedReader 对象读取一个字符要使用 read() 方法，它的语法如下：
int read( ) throws IOException
每次调用 read() 方法，它从输入流读取一个字符并把该字符作为整数值返回。 当流结束的时候返回 -1。该方法抛出 IOException。
下面的程序示范了用 read() 方法从控制台不断读取字符直到用户输入 "q"。
1.3. BRRead.java 文件代码：
//使用 BufferedReader 在控制台读取字符

 import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;

public class Li {
    public static void main(String[] args) throws IOException {
        test01();
        test02();
    }

    public static void test01() throws IOException {
        BufferedReader bufferedReader = new BufferedReader(new InputStreamReader(System.in));
        System.out.println("请输入一个字符");
        char c;
        c = (char) bufferedReader.read();
        System.out.println("你输入的字符为" + c);
    }

    public static void test02() throws IOException {
        BufferedReader bufferedReader = new BufferedReader(new InputStreamReader(System.in));
        System.out.println("请输入一个字符，按 q 键结束");
        char c;
        do {
            c = (char) bufferedReader.read();
            System.out.println("你输入的字符为" + c);
        } while (c != 'q');
    }
}
以上实例编译运行结果如下:
请输入一个字符
a
你输入的字符为a


请输入一个字符，按 q 键结束
aaaaaaq
你输入的字符为a
你输入的字符为a
你输入的字符为a
你输入的字符为a
你输入的字符为a
你输入的字符为a
你输入的字符为q

1.4. 从控制台读取字符串
从标准输入读取一个字符串需要使用 BufferedReader 的 readLine() 方法。
它的一般格式是：
String readLine( ) throws IOException
下面的程序读取和显示字符行直到你输入了单词"end"。
1.5. BRReadLines.java 文件代码：
//使用 BufferedReader 在控制台读取字符

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;

public class Li {
    public static void main(String[] args) throws IOException {
        // 三个测试方法
        test03();
    }

    public static void test03() throws IOException {
        BufferedReader bufferedReader = new BufferedReader(new InputStreamReader(System.in));
        String str;
        System.out.println("请输入一行字符");
        System.out.println("输入end退出");
        do {
            str = bufferedReader.readLine();
            System.out.println("输入的是=>" + str);
        } while (!str.equals("end"));
        System.out.println("你输入的字符为" + str);
    }
}
以上实例编译运行结果如下:
请输入一行字符
输入end退出
aaaaaaaaaaa
输入的是=>aaaaaaaaaaa
ccccccccccc
输入的是=>ccccccccccc
end
输入的是=>end
你输入的字符为end

JDK 5 后的版本我们也可以使用 Java Scanner 类来获取控制台的输入。

1.6. 控制台输出
在此前已经介绍过，控制台的输出由 print( ) 和 println() 完成。这些方法都由类 PrintStream 定义，System.out 是该类对象的一个引用。
PrintStream 继承了 OutputStream类，并且实现了方法 write()。这样，write() 也可以用来往控制台写操作。
PrintStream 定义 write() 的最简单格式如下所示：
void write(int byteval)
该方法将 byteval 的低八位字节写到流中。
1.6.1. 实例
下面的例子用 write() 把字符 "A" 和紧跟着的换行符输出到屏幕：
1.7. WriteDemo.java 文件代码：
import java.io.*;

//演示 System.out.write().
public class WriteDemo {
    public static void main(String args[]) {
        int b;
        b = 'A';
        System.out.write(b);
        System.out.write('\n');
    }
}
运行以上实例在输出窗口输出 "A" 字符
